import React from "react";
import {
  Container,
  Row,
  Col,
  Card,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button,
} from "reactstrap";

function Homepage() {
  return (
    <Container>
      <Row>
        <Col>

          <Card>
            <CardBody>
              <CardTitle>Card title</CardTitle>

              <CardText>
                Some quick example text to build on the card title and make up
                the bulk of the card's content.
              </CardText>
            </CardBody>
          </Card>








        </Col>
      </Row>
    </Container>
  );
}

export default Homepage;
